  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Community Health Status Indicators (CHSI)
  to combat obesity, heart disease, and cancer are major components of the Community
  Health Data Initiative.  This dataset provides key health indicators for local communities
  and encourages dialogue about actions that can be taken to improve community health
  (e.g., obesity, heart disease, cancer). The CHSI report and dataset was designed
  not only for public health professionals but also for members of the community who
  are interested in the health of their community. The CHSI report contains over 200
  measures for each of the 3,141 United States counties. Although CHSI presents indicators
  like deaths due to heart disease and cancer, it is imperative to understand that
  behavioral factors such as obesity, tobacco use, diet, physical activity, alcohol
  and drug use, sexual behavior and others substantially contribute to these deaths.</p>n\",\n\t\"license_title\":
